import * as FormData from 'form-data';
import { parse, prettyPrint } from './index';

describe('multipart parser', () => {
  let formData: FormData
  const imageData = Buffer.from('', 'base64')

  beforeEach(() => {
    formData = new FormData();
    formData.append('a', 'value1');
    formData.append('b', 'value2', {
      contentType: 'text/plain'
    });
    formData.append(
      'c',
      imageData,
      {
        filename: 'a.jpeg',
        contentType: 'image/jpeg',
      },
    );
  })

  it('should parse correctly', () => {
    const boundary = formData.getBoundary();
    console.log(boundary);
    const body = formData.getBuffer();
    const multipart = parse(body, boundary);
    console.log(multipart)
    expect(multipart.parts.length).toEqual(3);
    expect(multipart.parts[0].contentDisposition.name).toEqual('a');
    expect(multipart.parts[0].data.toString()).toEqual('value1');
    expect(multipart.parts[1].contentDisposition.name).toEqual('b');
    expect(multipart.parts[1].data.toString()).toEqual('value2');
    expect(multipart.parts[2].contentDisposition.name).toEqual('c');
    expect(multipart.parts[2].contentDisposition.filename).toEqual('a.jpeg');
    expect(multipart.parts[2].contentType).toEqual('image/jpeg');
    expect(multipart.parts[2].data.toString('base64')).toEqual(imageData.toString('base64'));


  });

  it('should stringify correctly', () => {
    const boundary = formData.getBoundary();
    console.log(boundary);
    const body = formData.getBuffer();
    const multipart = parse(body, boundary);
    console.log(multipart)

    console.log(body, prettyPrint(body));
    // expect(prettyPrint(body)).toEqual(body.toString())
  })
});
